import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaShoppingCart, FaHeart, FaUser, FaBars, FaTimes } from 'react-icons/fa';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [user, setUser] = useState(null);
  const [cartItems, setCartItems] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const userData = localStorage.getItem('userInfo');
    if (userData) {
      setUser(JSON.parse(userData));
    }

    const cart = localStorage.getItem('cartItems');
    if (cart) {
      setCartItems(JSON.parse(cart));
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('userInfo');
    localStorage.removeItem('cartItems');
    setUser(null);
    setCartItems([]);
    navigate('/');
  };

  return (
    <nav className="navbar">
      <div className="nav-container">
        <Link to="/" className="nav-logo">
          SportFit Women
        </Link>

        <div className={isOpen ? "nav-menu active" : "nav-menu"}>
          <Link to="/" className="nav-link" onClick={() => setIsOpen(false)}>
            Home
          </Link>
          <Link to="/products" className="nav-link" onClick={() => setIsOpen(false)}>
            Products
          </Link>
          <Link to="/about" className="nav-link" onClick={() => setIsOpen(false)}>
            About
          </Link>
          <Link to="/contact" className="nav-link" onClick={() => setIsOpen(false)}>
            Contact
          </Link>
          <Link to="/faq" className="nav-link" onClick={() => setIsOpen(false)}>
            FAQ
          </Link>
        </div>

        <div className="nav-icons">
          {user ? (
            <div className="user-menu">
              <div className="dropdown">
                <FaUser className="nav-icon" />
                <div className="dropdown-content">
                  <Link to="/profile">Profile</Link>
                  <Link to="/orders">Orders</Link>
                  {user.isAdmin && <Link to="/admin/dashboard">Admin</Link>}
                  <button onClick={handleLogout}>Logout</button>
                </div>
              </div>
            </div>
          ) : (
            <Link to="/login" className="nav-icon">
              <FaUser />
            </Link>
          )}
          
          <Link to="/wishlist" className="nav-icon">
            <FaHeart />
          </Link>
          
          <Link to="/cart" className="nav-icon cart-icon">
            <FaShoppingCart />
            {cartItems.length > 0 && (
              <span className="cart-badge">{cartItems.length}</span>
            )}
          </Link>
        </div>

        <div className="nav-toggle" onClick={() => setIsOpen(!isOpen)}>
          {isOpen ? <FaTimes /> : <FaBars />}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
